import React, { useState } from "react";
import './App.css';
import './index.css';
import dashboardIcon from './images/dashboard_icon.png';
import posIcon from './images/POS_icon.png';
import historyIcon from './images/history_icon.png';
import medicineImage from './images/medicine.png';
import vitaminsImage from './images/vitamins&supplements.png';
import personalCareImage from './images/personalcare.png';
import firstAidImage from './images/firstaid.png';
import healthWellnessImage from './images/health&wellness.png';
import babyCareImage from './images/babycare.png';

function App() {
  const [selectedCategory, setSelectedCategory] = useState("OTC Medications");

  const categories = [
    "OTC Medications", "Vitamins & Supplements", "Personal Care", 
    "First Aid", "Health & Wellness", "Baby Care"
  ];

  const products = {
    "OTC Medications": [
      { name: "Acetaminophen 500mg", price: "$8.99", stock: 150 },
      { name: "Ibuprofen 200mg", price: "$9.49", stock: 200 },
      { name: "Aspirin 81mg", price: "$7.99", stock: 180 },
      { name: "Allergy Relief (Loratadine)", price: "$12.99", stock: 120 },
      { name: "Cough Syrup", price: "$10.99", stock: 85 },
      { name: "Antacid Tablets", price: "$8.49", stock: 160 },
      { name: "Cold & Flu Relief", price: "$11.99", stock: 95 }
    ],
    "Vitamins & Supplements": [
      { name: "Multivitamin Daily", price: "$15.99", stock: 140 },
      { name: "Vitamin D3 2000 IU", price: "$12.99", stock: 110 },
      { name: "Vitamin C 1000mg", price: "$13.49", stock: 130 },
      { name: "Omega-3 Fish Oil", price: "$18.99", stock: 90 },
      { name: "Calcium + Vitamin D", price: "$14.99", stock: 105 },
      { name: "Probiotic Complex", price: "$24.99", stock: 75 }
    ],
    "Personal Care": [
      { name: "Hand Sanitizer 8oz", price: "$5.99", stock: 220 },
      { name: "Toothpaste Whitening", price: "$6.49", stock: 180 },
      { name: "Mouthwash Antiseptic", price: "$7.99", stock: 140 },
      { name: "Dental Floss", price: "$3.99", stock: 200 },
      { name: "Body Lotion 16oz", price: "$9.99", stock: 100 },
      { name: "Sunscreen SPF 50", price: "$12.99", stock: 85 },
      { name: "Shampoo & Conditioner", price: "$11.99", stock: 120 }
    ],
    "First Aid": [
      { name: "Adhesive Bandages (100ct)", price: "$6.99", stock: 150 },
      { name: "Gauze Pads Sterile", price: "$8.49", stock: 110 },
      { name: "Medical Tape", price: "$4.99", stock: 130 },
      { name: "Antiseptic Wipes (50ct)", price: "$7.49", stock: 140 },
      { name: "First Aid Kit", price: "$24.99", stock: 45 },
      { name: "Thermometer Digital", price: "$12.99", stock: 65 }
    ],
    "Health & Wellness": [
      { name: "Blood Pressure Monitor", price: "$49.99", stock: 35 },
      { name: "Glucose Test Strips (50ct)", price: "$32.99", stock: 55 },
      { name: "Heating Pad Electric", price: "$29.99", stock: 40 },
      { name: "Compression Socks", price: "$16.99", stock: 80 },
      { name: "Sleep Aid Tablets", price: "$14.99", stock: 95 },
      { name: "Eye Drops Lubricating", price: "$9.99", stock: 120 }
    ],
    "Baby Care": [
      { name: "Baby Diapers (Size 3)", price: "$24.99", stock: 70 },
      { name: "Baby Wipes (80ct)", price: "$6.99", stock: 150 },
      { name: "Baby Lotion 16oz", price: "$8.99", stock: 90 },
      { name: "Baby Powder", price: "$5.99", stock: 110 },
      { name: "Diaper Rash Cream", price: "$7.99", stock: 100 }
    ]
  };

  const handleCategoryChange = (category) => setSelectedCategory(category);

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-items">
          <img src={dashboardIcon} alt="Dashboard" className="icon"/>
          <span>Dashboard</span>
          <img src={posIcon} alt="POS" className="icon"/>
          <span>POS</span>
          <img src={historyIcon} alt="History" className="icon"/>
          <span>History</span>
        </div>
      </nav>
      <div className="pos-content">
        <div className="search-bar">
          <input type="text" placeholder="Search products..." />
        </div>
        <div className="categories">
          {categories.map((category, index) => (
            <button key={index} onClick={() => handleCategoryChange(category)}>{category}</button>
          ))}
        </div>
        <div className="products">
          <div className="product-category">
            <h3>{selectedCategory}</h3>
            <img 
              src={
                selectedCategory === "OTC Medications" ? medicineImage : 
                selectedCategory === "Vitamins & Supplements" ? vitaminsImage : 
                selectedCategory === "Personal Care" ? personalCareImage :
                selectedCategory === "First Aid" ? firstAidImage :
                selectedCategory === "Health & Wellness" ? healthWellnessImage :
                babyCareImage
              } 
              alt={selectedCategory} 
            />
            {products[selectedCategory].map((product, index) => (
              <div key={index} className="product-item">
                <h4>{product.name}</h4>
                <p>{product.price}</p>
                <p>Stock: {product.stock}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
